import React from "react";
import ReactDOM from "react-dom/client";
import { BrowserRouter as Router } from "react-router-dom";
import App from "./App";

const root = ReactDOM.
ReactDOM.render(
  <Router>
    <App />
  </Router>,
  document.getElementById("root")
);
